const WIDTH: usize = 16;
const HEIGHT: usize = 16;
// const SAMPLES: usize = 6483;
const TRAINING_SIZE: usize = 5186;
const TESTING_SIZE: usize = 1297;
const LEARNING_RATE: f64 = 0.0001;
const LEARNING_RATE_DISCOUNT_FACTOR: f64 = 0.9999;

/// mbti data is grayscale 0-1 range
type Pixel = f64;

#[wasm_bindgen]
#[derive(Clone, Debug, PartialEq)]
pub struct Image {
    data: Vec<Pixel>,
}

#[wasm_bindgen]
impl Image {
    /// Creates a new Image
    pub fn new() -> Image {
        Image {
            data: Vec::with_capacity(WIDTH * HEIGHT),
        }
    }

    /// Accesses the data buffer of this Image, for JavaScript to fill with the actual data
    pub fn buffer(&mut self) -> *const Pixel {
        self.data.as_ptr()
    }

    pub fn set_length(&mut self) {
        // this is safe because we will only call it after initialising all elements
        // via buffer access on the JS side
        unsafe {
            self.data.set_len(WIDTH * HEIGHT);
        }
    }
}

impl From<Image> for Matrix<f64> {
    fn from(image: Image) -> Self {
        Matrix::from_flat_row_major((1, WIDTH * HEIGHT), image.data).map(|pixel| pixel)
    }
}

/// A label type for the MBTI personality types consisting of 8 possible letters
#[wasm_bindgen]
#[repr(u8)]
#[derive(Clone, Copy, Debug, PartialEq, Eq)]
pub enum MBType {
    I = 0b10000000,
    E = 0b01000000,
    S = 0b00100000,
    N = 0b00010000,
    T = 0b00001000,
    F = 0b00000100,
    J = 0b00000010,
    P = 0b00000001,
}

// A label for the MBTI personality types consisting of 16 possible classifiers
#[wasm_bindgen]
#[repr(u8)]
#[derive(Clone, Copy, Debug, PartialEq, Eq)]
pub enum MBTI {
    ESFJ = 0,  // "ESFJ",
    ESFP = 1,  // "ESFP",
    ESTJ = 2,  // "ESTJ",
    ESTP = 3,  // "ESTP",
    ENFJ = 4,  // "ENFJ",
    ENFP = 5,  // "ENFP",
    ENTJ = 6,  // "ENTJ",
    ENTP = 7,  // "ENTP",
    ISFJ = 8,  // "ISFJ",
    ISFP = 9,  // "ISFP",
    ISTJ = 10, // "ISTJ",
    ISTP = 11, // "ISTP",
    INFJ = 12, // "INFJ",
    INFP = 13, // "INFP",
    INTJ = 14, // "INTJ",
    INTP = 15, // "INTP",
}

impl TryFrom<u8> for MBTI {
    type Error = &'static str;

    fn try_from(integer: u8) -> Result<Self, Self::Error> {
        match integer {
            0 => Ok(MBTI::ESFJ),
            1 => Ok(MBTI::ESFP),
            2 => Ok(MBTI::ESTJ),
            3 => Ok(MBTI::ESTP),
            4 => Ok(MBTI::ENFJ),
            5 => Ok(MBTI::ENFP),
            6 => Ok(MBTI::ENTJ),
            7 => Ok(MBTI::ENTP),
            8 => Ok(MBTI::ISFJ),
            9 => Ok(MBTI::ISFP),
            10 => Ok(MBTI::ISTJ),
            11 => Ok(MBTI::ISTP),
            12 => Ok(MBTI::INFJ),
            13 => Ok(MBTI::INFP),
            14 => Ok(MBTI::INTJ),
            15 => Ok(MBTI::INTP),
            _ => Err("Invalid MBTI type"),
        }
    }
}

impl From<&str> for MBTI {
    fn from(label: &str) -> Self {
        match label {
            "ESFJ" => MBTI::ESFJ,
            "ESFP" => MBTI::ESFP,
            "ESTJ" => MBTI::ESTJ,
            "ESTP" => MBTI::ESTP,
            "ENFJ" => MBTI::ENFJ,
            "ENFP" => MBTI::ENFP,
            "ENTJ" => MBTI::ENTJ,
            "ENTP" => MBTI::ENTP,
            "ISFJ" => MBTI::ISFJ,
            "ISFP" => MBTI::ISFP,
            "ISTJ" => MBTI::ISTJ,
            "ISTP" => MBTI::ISTP,
            "INFJ" => MBTI::INFJ,
            "INFP" => MBTI::INFP,
            "INTJ" => MBTI::INTJ,
            "INTP" => MBTI::INTP,
            _ => panic!("Invalid MBTI type"),
        }
    }
}

